	@SuppressWarnings("unchecked")
	@Override
	public List<CrawlResultBase> crawl() throws Exception {
		synchronized(Crawler.class){
			if(cityMap.size()==0){
				initCityMap();
			}
		}
		String httpResult = this.httpResult();
		if(this.isTimeout()) return null;
		
		List<CrawlResultBase> crawlResults = new ArrayList<CrawlResultBase>();
		if(httpResult==null) return crawlResults;
        try{
        	Document document = Jsoup.parse(httpResult);
        	Elements tables = document.getElementsByClass("table_list");
        	if(tables.size()==0)return crawlResults;
        	Element table = document.getElementsByClass("table_list").get(0);
        	Elements flights = table.getElementsByClass("flight");
        	for(Element e :flights){
        		Elements areas = e.select("[class$=_area]");
        		if(areas.size()==0)continue;
        		String flightMes = e.attr("data-flightlist");
        		JSONArray Flights = JSONObject.parseArray(flightMes);
        		List<FlightSegment> fss = new ArrayList<FlightSegment>();
				int segmentSize = Flights.size();
				for(int s = 0;s<segmentSize; s++){
					FlightSegment fs = new FlightSegment();
					fs.setTripNo(s+1);
					JSONObject seg = Flights.getJSONObject(s);
					String depCode = seg.getString("departureAirport");
					String desCode = seg.getString("arrivalAirport");
					String flightEn = seg.getString("carrierCode");
					String flightNumber = flightEn+seg.getString("flightNo");
					SimpleDateFormat sdf1 = new SimpleDateFormat("yyyyMMddHHmmss");
					SimpleDateFormat sdf2 = new SimpleDateFormat("yyyy-MM-dd HH:mm:ss");
					String depTime = seg.getString("departureDate");
					String desTime = seg.getString("arrivalDate");
					depTime = sdf2.format(sdf1.parse(depTime));
					desTime = sdf2.format(sdf1.parse(desTime));
					fs.setAirlineCode(flightEn);
					fs.setFlightNumber(flightNumber);
					fs.setCodeShare("N");
					fs.setDepAirport(depCode);
					fs.setArrAirport(desCode);
					fs.setDepTime(depTime);
					fs.setArrTime(desTime);
					fss.add(fs);
				}
				FlightData flightData = null;
				for(Element price : areas){
					Element input = price.getElementsByTag("input").get(0);
					Element seat = price.getElementsByClass("seat").get(0);
					String seatNum = seat.text().substring(0,1);
					String fareData = input.attr("data-paxfare");
					String[] data_bkc = input.attr("data-bkc").split("\\/");
					JSONArray fare = JSONObject.parseArray(fareData);
					JSONObject f = fare.getJSONObject(0);
					String barePrice = f.getString("amountWithoutTax");
					String taxPrice = f.getString("totalTax");
					String currency = f.getString("currency");
					
					flightData = new FlightData(this.getJobDetail(), "OW", dep, des, depDate);
				    flightData.setAirlineCode("OZ");
					SimpleDateFormat sdf = new SimpleDateFormat("yyyy-MM-dd HH:mm:ss");
					String date = sdf.format(new Date());
					flightData.setCreateTime(date);
					
					List<FlightPrice> prices = new ArrayList<FlightPrice>();
					FlightPrice fPrice = new FlightPrice();
					fPrice.setCurrency(currency);
					fPrice.setEquivCurrency(currency);
					fPrice.setEquivFare(barePrice);
					fPrice.setFare(barePrice);
					fPrice.setEquivTax(taxPrice);
					fPrice.setTax(taxPrice);
					fPrice.setPassengerType("ADT");
					prices.add(fPrice);
					flightData.setPrices(prices);
					
					List<FlightSegment> newFss = new ArrayList<FlightSegment>();
					int c = 0;
					for(FlightSegment fs:fss){
						FlightSegment newFs = (FlightSegment)fs.clone();
						String cabin = data_bkc[c];
						newFs.setCabin(cabin);
						newFs.setCabinCount(seatNum);
						newFss.add(newFs);
						c++;
					}
					flightData.setFromSegments(newFss);
					crawlResults.add(flightData);
				}
        	}
		} catch(Exception e) {
			logger.error(this.getJobDetail().toStr() + ", 采集航班信息异常:\r", e);
			throw e;
		}
        String pase = JSONObject.toJSONString(crawlResults);
		return crawlResults;
	}
	
